INSERT INTO `SYSTEM_VARIABLES` VALUES ('REPORT_HOST', NULL, '', 'COMPILE-TIME', '', 'GLOBAL', 'VARCHAR', 'Hostname or IP of the slave to be reported to the master during slave registration. Will appear in the output of SHOW SLAVE HOSTS. Leave unset if you do not want the slave to register itself with the master. Note that it is not sufficient for the master to simply read the IP of the slave off the socket once the slave connects. Due to NAT and other routing issues, that IP may not be valid for connecting to the slave from the master or other hosts', NULL, NULL, NULL, NULL, 'YES', 'REQUIRED', NULL);
