INSERT INTO `SYSTEM_VARIABLES` VALUES ('SLAVE_PARALLEL_THREADS', NULL, '0', 'COMPILE-TIME', '0', 'GLOBAL', 'INT UNSIGNED', 'If non-zero, number of threads to spawn to apply in parallel events on the slave that were group-committed on the master or were logged with GTID in different replication domains. Note that these threads are in addition to the IO and SQL threads, which are always created by a replication slave', '0', '16383', '1', NULL, 'NO', 'REQUIRED', NULL);
