INSERT INTO `SYSTEM_VARIABLES` VALUES ('MYISAM_RECOVER_OPTIONS', NULL, 'BACKUP,QUICK', 'COMPILE-TIME', 'BACKUP,QUICK', 'GLOBAL', 'SET', 'Specifies how corrupted tables should be automatically repaired', NULL, NULL, NULL, 'DEFAULT,BACKUP,FORCE,QUICK,BACKUP_ALL,OFF', 'YES', 'OPTIONAL', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('BINLOG_FORMAT', 'MIXED', 'MIXED', 'COMPILE-TIME', 'MIXED', 'SESSION', 'ENUM', 'What form of binary logging the master will use: either ROW for row-based binary logging, STATEMENT for statement-based binary logging, or MIXED. MIXED is statement-based binary logging except for those statements where only row-based is correct: those which involve user-defined functions (i.e. UDFs) or the UUID() function; for those, row-based binary logging is automatically used.', NULL, NULL, NULL, 'MIXED,STATEMENT,ROW', 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('RPL_SEMI_SYNC_MASTER_TIMEOUT', NULL, '10000', 'COMPILE-TIME', '10000', 'GLOBAL', 'INT UNSIGNED', 'The timeout value (in ms) for semi-synchronous replication in the master', '0', '4294967295', '1', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('THREAD_POOL_MAX_THREADS', NULL, '65536', 'COMPILE-TIME', '65536', 'GLOBAL', 'INT UNSIGNED', 'Maximum allowed number of worker threads in the thread pool', '1', '65536', '1', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('LOW_PRIORITY_UPDATES', 'OFF', 'OFF', 'COMPILE-TIME', 'OFF', 'SESSION', 'BOOLEAN', 'INSERT/DELETE/UPDATE has lower priority than selects', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('CHARACTER_SET_RESULTS', 'utf8mb4', 'latin1', 'COMPILE-TIME', 'latin1', 'SESSION', 'ENUM', 'The character set used for returning query results to the client', NULL, NULL, NULL, NULL, 'NO', NULL, NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('REPORT_PASSWORD', NULL, '', 'COMPILE-TIME', '', 'GLOBAL', 'VARCHAR', 'The account password of the slave to be reported to the master during slave registration', NULL, NULL, NULL, NULL, 'YES', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('SLAVE_RUN_TRIGGERS_FOR_RBR', NULL, 'NO', 'COMPILE-TIME', 'NO', 'GLOBAL', 'ENUM', 'Modes for how triggers in row-base replication on slave side will be executed. Legal values are NO (default), YES, LOGGING and ENFORCE. NO means that trigger for RBR will not be running on slave. YES and LOGGING means that triggers will be running on slave, if there was not triggers running on the master for the statement. LOGGING also means results of that the executed triggers work will be written to the binlog. ENFORCE means that triggers will always be run on the slave, even if there are triggers on the master. ENFORCE implies LOGGING.', NULL, NULL, NULL, 'NO,YES,LOGGING,ENFORCE', 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('WSREP_DBUG_OPTION', NULL, '', 'COMPILE-TIME', '', 'GLOBAL', 'VARCHAR', 'DBUG options to provider library', NULL, NULL, NULL, NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('CHARACTER_SET_CONNECTION', 'utf8mb4', 'latin1', 'COMPILE-TIME', 'latin1', 'SESSION', 'ENUM', 'The character set used for literals that do not have a character set introducer and for number-to-string conversion', NULL, NULL, NULL, NULL, 'NO', NULL, NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('SQL_BIG_SELECTS', 'ON', 'ON', 'COMPILE-TIME', 'OFF', 'SESSION', 'BOOLEAN', 'If set to 0, MariaDB will not perform large SELECTs. See max_join_size for details. If max_join_size is set to anything but DEFAULT, sql_big_selects is automatically set to 0. If sql_big_selects is again set, max_join_size will be ignored.', NULL, NULL, NULL, 'OFF,ON', 'NO', NULL, NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('DELAY_KEY_WRITE', NULL, 'ON', 'COMPILE-TIME', 'ON', 'GLOBAL', 'ENUM', 'Specifies how MyISAM tables handles CREATE TABLE DELAY_KEY_WRITE. If set to ON, the default, any DELAY KEY WRITEs are honored. The key buffer is then flushed only when the table closes, speeding up writes. MyISAM tables should be automatically checked upon startup in this case, and --external locking should not be used, as it can lead to index corruption. If set to OFF, DELAY KEY WRITEs are ignored, while if set to ALL, all new opened tables are treated as if created with DELAY KEY WRITEs enabled.', NULL, NULL, NULL, 'OFF,ON,ALL', 'NO', 'OPTIONAL', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('TRANSACTION_ALLOC_BLOCK_SIZE', '8192', '8192', 'COMPILE-TIME', '8192', 'SESSION', 'INT UNSIGNED', 'Allocation block size for transactions to be stored in binary log', '1024', '134217728', '1024', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('PERFORMANCE_SCHEMA_MAX_PROGRAM_INSTANCES', NULL, '-1', 'COMPILE-TIME', '-1', 'GLOBAL', 'INT', 'Maximum number of instrumented programs. Use 0 to disable, -1 for automated scaling.', '-1', '1048576', '1', NULL, 'YES', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('INNODB_FLUSHING_AVG_LOOPS', NULL, '30', 'COMPILE-TIME', '30', 'GLOBAL', 'INT UNSIGNED', 'Number of iterations over which the background flushing is averaged.', '1', '1000', '0', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('EXPLICIT_DEFAULTS_FOR_TIMESTAMP', 'OFF', 'OFF', 'COMPILE-TIME', 'OFF', 'SESSION', 'BOOLEAN', 'This option causes CREATE TABLE to create all TIMESTAMP columns as NULL with DEFAULT NULL attribute, Without this option, TIMESTAMP columns are NOT NULL and have implicit DEFAULT clauses.', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('SYNC_FRM', NULL, 'ON', 'COMPILE-TIME', 'ON', 'GLOBAL', 'BOOLEAN', 'Sync .frm files to disk on creation', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('COMPLETION_TYPE', 'NO_CHAIN', 'NO_CHAIN', 'COMPILE-TIME', 'NO_CHAIN', 'SESSION', 'ENUM', 'The transaction completion type', NULL, NULL, NULL, 'NO_CHAIN,CHAIN,RELEASE', 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('BINLOG_ROW_METADATA', NULL, 'NO_LOG', 'COMPILE-TIME', 'NO_LOG', 'GLOBAL', 'ENUM', 'Controls whether metadata is logged using FULL , MINIMAL format and NO_LOG.FULL causes all metadata to be logged; MINIMAL means that only metadata actually required by slave is logged; NO_LOG NO metadata will be logged.Default: NO_LOG.', NULL, NULL, NULL, 'NO_LOG,MINIMAL,FULL', 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('PID_FILE', NULL, '/var/run/mysql/mysqld.pid', 'COMMAND-LINE', '', 'GLOBAL', 'VARCHAR', 'Pid file used by safe_mysqld', NULL, NULL, NULL, NULL, 'YES', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('ARIA_PAGE_CHECKSUM', NULL, 'ON', 'COMPILE-TIME', 'ON', 'GLOBAL', 'BOOLEAN', 'Maintain page checksums (can be overridden per table with PAGE_CHECKSUM clause in CREATE TABLE)', NULL, NULL, NULL, 'OFF,ON', 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('MAX_INSERT_DELAYED_THREADS', '20', '20', 'COMPILE-TIME', '20', 'SESSION', 'INT UNSIGNED', 'Don\'t start more than this number of threads to handle INSERT DELAYED statements. If set to zero INSERT DELAYED will be not used', '0', '16384', '1', NULL, 'NO', NULL, NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('INNODB_IO_CAPACITY_MAX', NULL, '2000', 'COMPILE-TIME', '4294967295', 'GLOBAL', 'INT UNSIGNED', 'Limit to which innodb_io_capacity can be inflated.', '100', '4294967295', '0', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('EVENT_SCHEDULER', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'ENUM', 'Enable the event scheduler. Possible values are ON, OFF, and DISABLED (keep the event scheduler completely deactivated, it cannot be activated run-time)', NULL, NULL, NULL, 'OFF,ON,DISABLED,ORIGINAL', 'NO', 'OPTIONAL', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('INNODB_IO_CAPACITY', NULL, '200', 'COMPILE-TIME', '200', 'GLOBAL', 'INT UNSIGNED', 'Number of IOPs the server can do. Tunes the background IO rate', '100', '4294967295', '0', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('FT_BOOLEAN_SYNTAX', NULL, '+ -><()~*:\"\"&|', 'COMPILE-TIME', '+ -><()~*:\"\"&|', 'GLOBAL', 'VARCHAR', 'List of operators for MATCH ... AGAINST ( ... IN BOOLEAN MODE)', NULL, NULL, NULL, NULL, 'NO', 'REQUIRED', NULL);
