INSERT INTO `SYSTEM_VARIABLES` VALUES ('HAVE_CRYPT', NULL, 'YES', 'COMPILE-TIME', NULL, 'GLOBAL', 'VARCHAR', 'If the crypt() system call is available this variable will be set to YES, otherwise it will be set to NO. If set to NO, the ENCRYPT() function cannot be used.', NULL, NULL, NULL, NULL, 'YES', NULL, NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('LOG_SLOW_FILTER', 'admin,filesort,filesort_on_disk,filesort_priority_queue,full_join,full_scan,query_cache,query_cache_miss,tmp_table,tmp_table_on_disk', 'admin,filesort,filesort_on_disk,filesort_priority_queue,full_join,full_scan,query_cache,query_cache_miss,tmp_table,tmp_table_on_disk', 'COMPILE-TIME', 'admin,filesort,filesort_on_disk,filesort_priority_queue,full_join,full_scan,query_cache,query_cache_miss,tmp_table,tmp_table_on_disk', 'SESSION', 'SET', 'Log only certain types of queries to the slow log. If variable empty all kind of queries are logged.  All types are bound by slow_query_time, except \'not_using_index\' which is always logged if enabled', NULL, NULL, NULL, 'admin,filesort,filesort_on_disk,filesort_priority_queue,full_join,full_scan,not_using_index,query_cache,query_cache_miss,tmp_table,tmp_table_on_disk', 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('COLUMN_COMPRESSION_ZLIB_LEVEL', '6', '6', 'COMPILE-TIME', '6', 'SESSION', 'INT UNSIGNED', 'zlib compression level (1 gives best speed, 9 gives best compression)', '0', '9', '1', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('ARIA_FORCE_START_AFTER_RECOVERY_FAILURES', NULL, '0', 'COMPILE-TIME', '0', 'GLOBAL', 'INT UNSIGNED', 'Number of consecutive log recovery failures after which logs will be automatically deleted to cure the problem; 0 (the default) disables the feature.', '0', '255', '1', NULL, 'YES', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('SLAVE_TRANSACTION_RETRY_ERRORS', NULL, '1158,1159,1160,1161,1205,1213,1429,2013,12701', 'COMPILE-TIME', '', 'GLOBAL', 'VARCHAR', 'Tells the slave thread to retry transaction for replication when a query event returns an error from the provided list. Deadlock error, elapsed lock wait timeout, net read error, net read timeout, net write error, net write timeout, connect error and 2 types of lost connection error are automatically added to this list', NULL, NULL, NULL, NULL, 'YES', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('INNODB_COMPRESSION_DEFAULT', 'OFF', 'OFF', 'COMPILE-TIME', 'OFF', 'SESSION', 'BOOLEAN', 'Is compression the default for new tables', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('DEFAULT_PASSWORD_LIFETIME', NULL, '0', 'COMPILE-TIME', '0', 'GLOBAL', 'INT UNSIGNED', 'This defines the global password expiration policy. 0 means automatic password expiration is disabled. If the value is a positive integer N, the passwords must be changed every N days. This behavior can be overridden using the password expiration options in ALTER USER.', '0', '4294967295', '1', NULL, 'NO', 'REQUIRED', NULL);
