INSERT INTO `SYSTEM_VARIABLES` VALUES ('RPL_SEMI_SYNC_SLAVE_DELAY_MASTER', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'Only write master info file when ack is needed.', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('FT_QUERY_EXPANSION_LIMIT', NULL, '20', 'COMPILE-TIME', '20', 'GLOBAL', 'INT UNSIGNED', 'Number of best matches to use for query expansion', '0', '1000', '1', NULL, 'YES', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('SQL_AUTO_IS_NULL', 'OFF', 'OFF', 'COMPILE-TIME', 'OFF', 'SESSION', 'BOOLEAN', 'If set to 1, the query SELECT * FROM table_name WHERE auto_increment_column IS NULL will return an auto-increment that has just been successfully inserted, the same as the LAST_INSERT_ID() function. Some ODBC programs make use of this IS NULL comparison.', NULL, NULL, NULL, 'OFF,ON', 'NO', NULL, NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('GTID_STRICT_MODE', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'Enforce strict seq_no ordering of events in the binary log. Slave stops with an error if it encounters an event that would cause it to generate an out-of-order binlog if executed. When ON the same server-id semisync-replicated transactions that duplicate exising ones in binlog are ignored without error and slave interruption.', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('ARIA_USED_FOR_TEMP_TABLES', NULL, 'ON', 'COMPILE-TIME', NULL, 'GLOBAL', 'BOOLEAN', 'Whether temporary tables should be MyISAM or Aria', NULL, NULL, NULL, 'OFF,ON', 'YES', NULL, NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('DELAYED_INSERT_LIMIT', NULL, '100', 'COMPILE-TIME', '100', 'GLOBAL', 'INT UNSIGNED', 'After inserting delayed_insert_limit rows, the INSERT DELAYED handler will check if there are any SELECT statements pending. If so, it allows these to execute before continuing.', '1', '4294967295', '1', NULL, 'NO', 'REQUIRED', NULL);
