INSERT INTO `SYSTEM_VARIABLES` VALUES ('BINLOG_DIRECT_NON_TRANSACTIONAL_UPDATES', 'OFF', 'OFF', 'COMPILE-TIME', 'OFF', 'SESSION', 'BOOLEAN', 'Causes updates to non-transactional engines using statement format to be written directly to binary log. Before using this option make sure that there are no dependencies between transactional and non-transactional tables such as in the statement INSERT INTO t_myisam SELECT * FROM t_innodb; otherwise, slaves may diverge from the master.', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL', NULL);
