INSERT INTO `SYSTEM_VARIABLES` VALUES ('GTID_IGNORE_DUPLICATES', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'When set, different master connections in multi-source replication are allowed to receive and process event groups with the same GTID (when using GTID mode). Only one will be applied, any others will be ignored. Within a given replication domain, just the sequence number will be used to decide whether a given GTID has been already applied; this means it is the responsibility of the user to ensure that GTID sequence numbers are strictly increasing.', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('SKIP_PARALLEL_REPLICATION', 'OFF', NULL, 'COMPILE-TIME', 'OFF', 'SESSION ONLY', 'BOOLEAN', 'If set when a transaction is written to the binlog, parallel apply of that transaction will be avoided on a slave where slave_parallel_mode is not \"aggressive\". Can be used to avoid unnecessary rollback and retry for transactions that are likely to cause a conflict if replicated in parallel.', NULL, NULL, NULL, 'OFF,ON', 'NO', NULL, NULL);
