INSERT INTO `SYSTEM_VARIABLES` VALUES ('INNODB_ENCRYPTION_ROTATION_IOPS', NULL, '100', 'COMPILE-TIME', '100', 'GLOBAL', 'INT UNSIGNED', 'Use this many iops for background key rotation', '0', '4294967295', '0', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('COLUMN_COMPRESSION_ZLIB_STRATEGY', 'DEFAULT_STRATEGY', 'DEFAULT_STRATEGY', 'COMPILE-TIME', 'DEFAULT_STRATEGY', 'SESSION', 'ENUM', 'The strategy parameter is used to tune the compression algorithm. Use the value DEFAULT_STRATEGY for normal data, FILTERED for data produced by a filter (or predictor), HUFFMAN_ONLY to force Huffman encoding only (no string match), or RLE to limit match distances to one (run-length encoding). Filtered data consists mostly of small values with a somewhat random distribution. In this case, the compression algorithm is tuned to compress them better. The effect of FILTERED is to force more Huffman coding and less string matching; it is somewhat intermediate between DEFAULT_STRATEGY and HUFFMAN_ONLY. RLE is designed to be almost as fast as HUFFMAN_ONLY, but give better compression for PNG image data. The strategy parameter only affects the compression ratio but not the correctness of the compressed output even if it is not set appropriately. FIXED prevents the use of dynamic Huffman codes, allowing for a simpler decoder for special applications.', NULL, NULL, NULL, 'DEFAULT_STRATEGY,FILTERED,HUFFMAN_ONLY,RLE,FIXED', 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('HAVE_DYNAMIC_LOADING', NULL, 'YES', 'COMPILE-TIME', NULL, 'GLOBAL', 'VARCHAR', 'If the server supports dynamic loading of plugins, will be set to YES, otherwise will be set to NO.', NULL, NULL, NULL, NULL, 'YES', NULL, NULL);
