INSERT INTO `SYSTEM_VARIABLES` VALUES ('PSEUDO_SLAVE_MODE', 'OFF', NULL, 'COMPILE-TIME', 'OFF', 'SESSION ONLY', 'BOOLEAN', 'SET pseudo_slave_mode= 0,1 are commands that mysqlbinlog adds to beginning and end of binary log dumps. While zero value indeed disables, the actual enabling of the slave applier execution mode is done implicitly when a Format_description_event is sent through the session.', NULL, NULL, NULL, 'OFF,ON', 'NO', NULL, NULL);
