INSERT INTO `SYSTEM_VARIABLES` VALUES ('SYNC_RELAY_LOG', NULL, '10000', 'COMPILE-TIME', '10000', 'GLOBAL', 'INT UNSIGNED', 'Synchronously flush relay log to disk after every #th event. Use 0 to disable synchronous flushing', '0', '4294967295', '1', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('MAX_DELAYED_THREADS', '20', '20', 'COMPILE-TIME', '20', 'SESSION', 'INT UNSIGNED', 'Don\'t start more than this number of threads to handle INSERT DELAYED statements. If set to zero INSERT DELAYED will be not used', '0', '16384', '1', NULL, 'NO', 'REQUIRED', NULL);
