INSERT INTO `SYSTEM_VARIABLES` VALUES ('DELAYED_QUEUE_SIZE', NULL, '1000', 'COMPILE-TIME', '1000', 'GLOBAL', 'INT UNSIGNED', 'What size queue (in rows) should be allocated for handling INSERT DELAYED. If the queue becomes full, any client that does INSERT DELAYED will wait until there is room in the queue again', '1', '4294967295', '1', NULL, 'NO', 'REQUIRED', NULL);
