INSERT INTO `SYSTEM_VARIABLES` VALUES ('SLAVE_NET_TIMEOUT', NULL, '60', 'COMPILE-TIME', '60', 'GLOBAL', 'INT UNSIGNED', 'Number of seconds to wait for more data from any master/slave connection before aborting the read', '1', '31536000', '1', NULL, 'NO', 'REQUIRED', NULL);
