INSERT INTO `SYSTEM_VARIABLES` VALUES ('THREAD_POOL_PRIORITY', 'auto', 'auto', 'COMPILE-TIME', 'auto', 'SESSION', 'ENUM', 'Threadpool priority. High priority connections usually start executing earlier than low priority.If priority set to \'auto\', the the actual priority(low or high) is determined based on whether or not connection is inside transaction.', NULL, NULL, NULL, 'high,low,auto', 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('EXPIRE_LOGS_DAYS', NULL, '0.000000', 'COMPILE-TIME', '0.000000', 'GLOBAL', 'DOUBLE', 'If non-zero, binary logs will be purged after expire_logs_days days; It and binlog_expire_logs_seconds are linked, such that changes in one are converted into the other, presentable as a decimal value with 1/1000000 of the day precision; possible purges happen at startup and at binary log rotation', '0', '99', NULL, NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('DATETIME_FORMAT', NULL, '%Y-%m-%d %H:%i:%s', 'COMPILE-TIME', '%Y-%m-%d %H:%i:%s', 'GLOBAL', 'VARCHAR', 'The DATETIME format (ignored)', NULL, NULL, NULL, NULL, 'YES', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('PERFORMANCE_SCHEMA_MAX_SQL_TEXT_LENGTH', NULL, '1024', 'COMPILE-TIME', '1024', 'GLOBAL', 'INT', 'Maximum length of displayed sql text.', '0', '1048576', '1', NULL, 'YES', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('INNODB_ADAPTIVE_FLUSHING_LWM', NULL, '10.000000', 'COMPILE-TIME', '10.000000', 'GLOBAL', 'DOUBLE', 'Percentage of log capacity below which no adaptive flushing happens.', '0', '70', NULL, NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('WSREP_GTID_MODE', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'Automatically update the (joiner) node\'s wsrep_gtid_domain_id value with that of donor\'s (received during state transfer) and use it in place of gtid_domain_id for all galera transactions. When OFF (default), wsrep_gtid_domain_id is simply ignored (backward compatibility).', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('INNODB_DEFRAGMENT_FREQUENCY', NULL, '40', 'COMPILE-TIME', '40', 'GLOBAL', 'INT UNSIGNED', 'Do not defragment a single index more than this number of time per second.This controls the number of time defragmentation thread can request X_LOCK on an index. Defragmentation thread will check whether 1/defragment_frequency (s) has passed since it worked on this index last time, and put the index back to the queue if not enough time has passed. The actual frequency can only be lower than this given number.', '1', '1000', '0', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('MIN_EXAMINED_ROW_LIMIT', '0', '0', 'COMPILE-TIME', '0', 'SESSION', 'INT UNSIGNED', 'Don\'t write queries to slow log that examine fewer rows than that', '0', '4294967295', '1', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('SQL_WARNINGS', 'OFF', 'OFF', 'COMPILE-TIME', 'OFF', 'SESSION', 'BOOLEAN', 'If set to 1, single-row INSERTs will produce a string containing warning information if a warning occurs.', NULL, NULL, NULL, 'OFF,ON', 'NO', NULL, NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('FT_MAX_WORD_LEN', NULL, '84', 'COMPILE-TIME', '84', 'GLOBAL', 'INT UNSIGNED', 'The maximum length of the word to be included in a FULLTEXT index. Note: FULLTEXT indexes must be rebuilt after changing this variable', '10', '84', '1', NULL, 'YES', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('STRICT_PASSWORD_VALIDATION', NULL, 'ON', 'COMPILE-TIME', 'ON', 'GLOBAL', 'BOOLEAN', 'When password validation plugins are enabled, reject passwords that cannot be validated (passwords specified as a hash)', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('RPL_SEMI_SYNC_SLAVE_KILL_CONN_TIMEOUT', NULL, '5', 'COMPILE-TIME', '5', 'GLOBAL', 'INT UNSIGNED', 'Timeout for the mysql connection used to kill the slave io_thread\'s connection on master. This timeout comes into play when stop slave is executed.', '0', '4294967295', '1', NULL, 'NO', 'OPTIONAL', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('RELAY_LOG_RECOVERY', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'Enables automatic relay log recovery right after the database startup, which means that the IO Thread starts re-fetching from the master right after the last transaction processed.', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('CONCURRENT_INSERT', NULL, 'AUTO', 'COMPILE-TIME', 'AUTO', 'GLOBAL', 'ENUM', 'Use concurrent insert with MyISAM', NULL, NULL, NULL, 'NEVER,AUTO,ALWAYS', 'NO', 'OPTIONAL', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('WSREP_GTID_DOMAIN_ID', NULL, '0', 'COMPILE-TIME', '0', 'GLOBAL', 'INT UNSIGNED', 'When wsrep_gtid_mode is set, this value is used as gtid_domain_id for galera transactions and also copied to the joiner nodes during state transfer. It is ignored, otherwise.', '0', '4294967295', '1', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('NOTE_VERBOSITY', 'basic,explain', 'basic,explain', 'COMPILE-TIME', 'basic,explain', 'SESSION', 'SET', 'Verbosity level for note-warnings given to the user. See also @@sql_notes.', NULL, NULL, NULL, 'basic,unusable_keys,explain', 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('THREAD_POOL_STALL_LIMIT', NULL, '500', 'COMPILE-TIME', '500', 'GLOBAL', 'INT UNSIGNED', 'Maximum query execution time in milliseconds,before an executing non-yielding thread is considered stalled.If a worker thread is stalled, additional worker thread may be created to handle remaining clients.', '1', '4294967295', '1', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('BINLOG_STMT_CACHE_SIZE', NULL, '32768', 'COMPILE-TIME', '32768', 'GLOBAL', 'BIGINT UNSIGNED', 'The size of the statement cache for updates to non-transactional engines for the binary log. If you often use statements updating a great number of rows, you can increase this to get more performance.', '4096', '4294967295', '4096', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('PERFORMANCE_SCHEMA_MAX_SOCKET_INSTANCES', NULL, '-1', 'COMPILE-TIME', '-1', 'GLOBAL', 'INT', 'Maximum number of opened instrumented sockets. Use 0 to disable, -1 for automated sizing.', '-1', '1048576', '1', NULL, 'YES', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('LOG_WARNINGS', '2', '2', 'COMPILE-TIME', '2', 'SESSION', 'INT UNSIGNED', 'Log some not critical warnings to the general log file.Value can be between 0 and 11. Higher values mean more verbosity', '0', '4294967295', '1', NULL, 'NO', 'OPTIONAL', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('TX_READ_ONLY', 'OFF', 'OFF', 'COMPILE-TIME', 'OFF', 'SESSION', 'BOOLEAN', 'Default transaction access mode. If set to OFF, the default, access is read/write. If set to ON, access is read-only. The SET TRANSACTION statement can also change the value of this variable. See SET TRANSACTION and START TRANSACTION.', NULL, NULL, NULL, 'OFF,ON', 'NO', NULL, NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('OPEN_FILES_LIMIT', NULL, '32186', 'AUTO', '0', 'GLOBAL', 'INT UNSIGNED', 'If this is not 0, then mysqld will use this value to reserve file descriptors to use with setrlimit(). If this value is 0 or autoset then mysqld will reserve max_connections*5 or max_connections + table_cache*2 (whichever is larger) number of file descriptors', '0', '4294967295', '1', NULL, 'YES', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('INNODB_RANDOM_READ_AHEAD', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'Whether to use read ahead for random access within an extent.', NULL, NULL, NULL, 'OFF,ON', 'NO', 'NONE', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('DISCONNECT_ON_EXPIRED_PASSWORD', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'This variable controls how the server handles clients that are not aware of the sandbox mode. If enabled, the server disconnects the client, otherwise the server puts the client in a sandbox mode.', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('TCP_KEEPALIVE_PROBES', NULL, '0', 'COMPILE-TIME', '0', 'GLOBAL', 'INT', 'The number of unacknowledged probes to send before considering the connection dead and notifying the application layer.If set to 0, system dependent default is used.', '0', '2147483', '1', NULL, 'NO', 'REQUIRED', NULL);
