INSERT INTO `SYSTEM_VARIABLES` VALUES ('PORT', NULL, '3306', 'COMMAND-LINE', '0', 'GLOBAL', 'INT UNSIGNED', 'Port number to use for connection or 0 to default to, my.cnf, $MYSQL_TCP_PORT, /etc/services, built-in default (3306), whatever comes first', '0', '4294967295', '1', NULL, 'YES', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('MAX_DIGEST_LENGTH', NULL, '1024', 'COMPILE-TIME', '1024', 'GLOBAL', 'INT UNSIGNED', 'Maximum length considered for digest text.', '0', '1048576', '1', NULL, 'YES', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('FLUSH_TIME', NULL, '0', 'COMPILE-TIME', '0', 'GLOBAL', 'INT UNSIGNED', 'A dedicated thread is created to flush all tables at the given interval', '0', '31536000', '1', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('QUERY_CACHE_WLOCK_INVALIDATE', 'OFF', 'OFF', 'COMPILE-TIME', 'OFF', 'SESSION', 'BOOLEAN', 'Invalidate queries in query cache on LOCK for write', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('LOG_BIN_TRUST_FUNCTION_CREATORS', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'If set to FALSE (the default), then when --log-bin is used, creation of a stored function (or trigger) is allowed only to users having the SUPER privilege and only if this stored function (trigger) may not break binary logging. Note that if ALL connections to this server ALWAYS use row-based binary logging, the security issues do not exist and the binary logging cannot break, so you can safely set this to TRUE', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('DATADIR', NULL, '/var/db/mysql/', 'COMMAND-LINE', '/var/db/mysql/', 'GLOBAL', 'VARCHAR', 'Path to the database root directory', NULL, NULL, NULL, NULL, 'YES', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('INNODB_MONITOR_DISABLE', NULL, '', 'COMPILE-TIME', '', 'GLOBAL', 'VARCHAR', 'Turn off a monitor counter', NULL, NULL, NULL, NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('SLAVE_EXEC_MODE', NULL, 'STRICT', 'COMPILE-TIME', 'STRICT', 'GLOBAL', 'ENUM', 'How replication events should be executed. Legal values are STRICT (default) and IDEMPOTENT. In IDEMPOTENT mode, replication will not stop for operations that are idempotent. For example, in row based replication attempts to delete rows that doesn\'t exist will be ignored. In STRICT mode, replication will stop on any unexpected difference between the master and the slave.', NULL, NULL, NULL, 'STRICT,IDEMPOTENT', 'NO', 'REQUIRED', NULL);
