INSERT INTO `SYSTEM_VARIABLES` VALUES ('RPL_SEMI_SYNC_MASTER_ENABLED', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'Enable semi-synchronous replication master (disabled by default).', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('INNODB_LOCK_WAIT_TIMEOUT', '50', '50', 'COMPILE-TIME', '50', 'SESSION', 'INT UNSIGNED', 'Timeout in seconds an InnoDB transaction may wait for a lock before being rolled back. The value 100000000 is infinite timeout.', '0', '100000000', '0', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('OPTIMIZER_SELECTIVITY_SAMPLING_LIMIT', '100', '100', 'COMPILE-TIME', '100', 'SESSION', 'INT UNSIGNED', 'Controls number of record samples to check condition selectivity', '10', '4294967295', '1', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('INNODB_OLD_BLOCKS_TIME', NULL, '1000', 'COMPILE-TIME', '1000', 'GLOBAL', 'INT UNSIGNED', 'Move blocks to the \'new\' end of the buffer pool if the first access was at least this many milliseconds ago. The timeout is disabled if 0.', '0', '4294967295', '0', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('KEY_CACHE_AGE_THRESHOLD', NULL, '300', 'COMPILE-TIME', '300', 'GLOBAL', 'BIGINT UNSIGNED', 'This characterizes the number of hits a hot block has to be untouched until it is considered aged enough to be downgraded to a warm block. This specifies the percentage ratio of that number of hits to the total number of blocks in key cache', '100', '4294967295', '100', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('WSREP_GTID_SEQ_NO', '0', NULL, 'COMPILE-TIME', '0', 'SESSION ONLY', 'BIGINT UNSIGNED', 'Internal server usage, manually set WSREP GTID seqno.', '0', '18446744073709551615', '1', NULL, 'NO', NULL, NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('BINLOG_COMMIT_WAIT_COUNT', NULL, '0', 'COMPILE-TIME', '0', 'GLOBAL', 'INT UNSIGNED', 'If non-zero, binlog write will wait at most binlog_commit_wait_usec microseconds for at least this many commits to queue up for group commit to the binlog. This can reduce I/O on the binlog and provide increased opportunity for parallel apply on the slave, but too high a value will decrease commit throughput.', '0', '4294967295', '1', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('SKIP_EXTERNAL_LOCKING', NULL, 'ON', 'COMPILE-TIME', NULL, 'GLOBAL', 'BOOLEAN', 'Don\'t use system (external) locking', NULL, NULL, NULL, 'OFF,ON', 'YES', NULL, NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('DEFAULT_MASTER_CONNECTION', '', NULL, 'COMPILE-TIME', '', 'SESSION ONLY', 'VARCHAR', 'Master connection to use for all slave variables and slave commands', NULL, NULL, NULL, NULL, 'NO', NULL, NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('INNODB_COMPRESSION_FAILURE_THRESHOLD_PCT', NULL, '5', 'COMPILE-TIME', '5', 'GLOBAL', 'INT UNSIGNED', 'If the compression failure rate of a table is greater than this number more padding is added to the pages to reduce the failures. A value of zero implies no padding', '0', '100', '0', NULL, 'NO', 'OPTIONAL', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('GENERAL_LOG', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'Log connections and queries to a table or log file. Defaults logging to a file \'hostname\'.log or a table mysql.general_logif --log-output=TABLE is used.', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('LOCKED_IN_MEMORY', NULL, 'OFF', 'COMPILE-TIME', NULL, 'GLOBAL', 'BOOLEAN', 'Whether mysqld was locked in memory with --memlock', NULL, NULL, NULL, 'OFF,ON', 'YES', NULL, NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('OPTIMIZER_PRUNE_LEVEL', '1', '1', 'COMPILE-TIME', '1', 'SESSION', 'INT UNSIGNED', 'Controls the heuristic(s) applied during query optimization to prune less-promising partial plans from the optimizer search space. Meaning: 0 - do not apply any heuristic, thus perform exhaustive search; 1 - prune plans based on number of retrieved rows', '0', '1', '1', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('INNODB_LRU_FLUSH_SIZE', NULL, '32', 'COMPILE-TIME', '32', 'GLOBAL', 'INT UNSIGNED', 'How many pages to flush on LRU eviction', '1', '4294967295', '0', NULL, 'NO', 'REQUIRED', NULL);
