INSERT INTO `SYSTEM_VARIABLES` VALUES ('THREAD_POOL_SIZE', NULL, '4', 'AUTO', '8', 'GLOBAL', 'INT UNSIGNED', 'Number of thread groups in the pool. This parameter is roughly equivalent to maximum number of concurrently executing threads (threads in a waiting state do not count as executing).', '1', '100000', '1', NULL, 'NO', 'REQUIRED', NULL);
