INSERT INTO `SYSTEM_VARIABLES` VALUES ('INNODB_DEFRAGMENT_FILL_FACTOR_N_RECS', NULL, '20', 'COMPILE-TIME', '20', 'GLOBAL', 'INT UNSIGNED', 'How many records of space defragmentation should leave on the page. This variable, together with innodb_defragment_fill_factor, is introduced so defragmentation won\'t pack the page too full and cause page split on the next insert on every page. The variable indicating more defragmentation gain is the one effective.', '1', '100', '0', NULL, 'NO', 'REQUIRED', NULL);
