INSERT INTO `SYSTEM_VARIABLES` VALUES ('HISTOGRAM_TYPE', 'DOUBLE_PREC_HB', 'DOUBLE_PREC_HB', 'COMPILE-TIME', 'DOUBLE_PREC_HB', 'SESSION', 'ENUM', 'Specifies type of the histograms created by ANALYZE. Possible values are: SINGLE_PREC_HB - single precision height-balanced, DOUBLE_PREC_HB - double precision height-balanced.', NULL, NULL, NULL, 'SINGLE_PREC_HB,DOUBLE_PREC_HB', 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('REPORT_PORT', NULL, '3306', 'AUTO', '0', 'GLOBAL', 'INT UNSIGNED', 'Port for connecting to slave reported to the master during slave registration. Set it only if the slave is listening on a non-default port or if you have a special tunnel from the master or other clients to the slave. If not sure, leave this option unset', '0', '4294967295', '1', NULL, 'YES', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('HAVE_COMPRESS', NULL, 'YES', 'COMPILE-TIME', NULL, 'GLOBAL', 'VARCHAR', 'If the zlib compression library is accessible to the server, this will be set to YES, otherwise it will be NO. The COMPRESS() and UNCOMPRESS() functions will only be available if set to YES.', NULL, NULL, NULL, NULL, 'YES', NULL, NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('WAIT_TIMEOUT', '28800', '28800', 'COMPILE-TIME', '28800', 'SESSION', 'INT UNSIGNED', 'The number of seconds the server waits for activity on a connection before closing it', '1', '31536000', '1', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('INNODB_USE_ATOMIC_WRITES', NULL, 'ON', 'COMPILE-TIME', 'ON', 'GLOBAL', 'BOOLEAN', 'Enable atomic writes, instead of using the doublewrite buffer, for files on devices that supports atomic writes.', NULL, NULL, NULL, 'OFF,ON', 'YES', 'NONE', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('LOG_SLOW_SLAVE_STATEMENTS', 'ON', 'ON', 'COMPILE-TIME', 'ON', 'SESSION', 'BOOLEAN', 'Log slow statements executed by slave thread to the slow log if it is open. Resets or sets the option \'slave\' in log_slow_disabled_statements', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('PROXY_PROTOCOL_NETWORKS', NULL, '', 'COMPILE-TIME', '', 'GLOBAL', 'VARCHAR', 'Enable proxy protocol for these source networks. The syntax is a comma separated list of IPv4 and IPv6 networks. If the network doesn\'t contain mask, it is considered to be a single host. \"*\" represents all networks and must the only directive on the line. String \"localhost\" represents non-TCP local connections (Unix domain socket, Windows named pipe or shared memory).', NULL, NULL, NULL, NULL, 'NO', 'REQUIRED', NULL);
