INSERT INTO `SYSTEM_VARIABLES` VALUES ('INNODB_DOUBLEWRITE', NULL, 'ON', 'COMPILE-TIME', 'ON', 'GLOBAL', 'BOOLEAN', 'Enable InnoDB doublewrite buffer (enabled by default). Disable with --skip-innodb-doublewrite.', NULL, NULL, NULL, 'OFF,ON', 'YES', 'NONE', NULL);
