INSERT INTO `SYSTEM_VARIABLES` VALUES ('SLOW_QUERY_LOG', 'OFF', 'OFF', 'COMPILE-TIME', 'OFF', 'SESSION', 'BOOLEAN', 'Log slow queries to a table or log file. Defaults logging to a file \'hostname\'-slow.log or a table mysql.slow_log if --log-output=TABLE is used. Must be enabled to activate other slow log options.', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL', NULL);
