INSERT INTO `SYSTEM_VARIABLES` VALUES ('BINLOG_COMMIT_WAIT_USEC', NULL, '100000', 'COMPILE-TIME', '100000', 'GLOBAL', 'INT UNSIGNED', 'Maximum time, in microseconds, to wait for more commits to queue up for binlog group commit. Only takes effect if the value of binlog_commit_wait_count is non-zero.', '0', '4294967295', '1', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('INNODB_STATS_PERSISTENT_SAMPLE_PAGES', NULL, '20', 'COMPILE-TIME', '20', 'GLOBAL', 'BIGINT UNSIGNED', 'The number of leaf index pages to sample when calculating persistent statistics (by ANALYZE, default 20)', '1', '18446744073709551615', '0', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('ARIA_RECOVER_OPTIONS', NULL, 'BACKUP,QUICK', 'COMPILE-TIME', 'BACKUP,QUICK', 'GLOBAL', 'SET', 'Specifies how corrupted tables should be automatically repaired', NULL, NULL, NULL, 'NORMAL,BACKUP,FORCE,QUICK,OFF', 'NO', 'OPTIONAL', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('ARIA_GROUP_COMMIT_INTERVAL', NULL, '0', 'COMPILE-TIME', '0', 'GLOBAL', 'INT UNSIGNED', 'Interval between commits in microseconds (1/1000000 sec). 0 stands for no waiting for other threads to come and do a commit in \"hard\" mode and no sync()/commit at all in \"soft\" mode.  Option has only an effect if aria_group_commit is used', '0', '4294967295', '1', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('GTID_DOMAIN_ID', '0', '0', 'COMPILE-TIME', '0', 'SESSION', 'INT UNSIGNED', 'Used with global transaction ID to identify logically independent replication streams. When events can propagate through multiple parallel paths (for example multiple masters), each independent source server must use a distinct domain_id. For simple tree-shaped replication topologies, it can be left at its default, 0.', '0', '4294967295', '1', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('PROFILING_HISTORY_SIZE', '15', '15', 'COMPILE-TIME', '15', 'SESSION', 'INT UNSIGNED', 'Number of statements about which profiling information is maintained. If set to 0, no profiles are stored. See SHOW PROFILES.', '0', '100', '1', NULL, 'NO', 'REQUIRED', NULL);
