INSERT INTO `SYSTEM_VARIABLES` VALUES ('MAX_RELAY_LOG_SIZE', '1073741824', '1073741824', 'AUTO', '1073741824', 'SESSION', 'BIGINT UNSIGNED', 'relay log will be rotated automatically when the size exceeds this value.  If 0 at startup, it\'s set to max_binlog_size', '4096', '1073741824', '4096', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('INNODB_STATS_MODIFIED_COUNTER', NULL, '0', 'COMPILE-TIME', '0', 'GLOBAL', 'BIGINT UNSIGNED', 'The number of rows modified before we calculate new statistics (default 0 = current limits)', '0', '18446744073709551615', '0', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('MAX_RECURSIVE_ITERATIONS', '1000', '1000', 'COMPILE-TIME', '1000', 'SESSION', 'INT UNSIGNED', 'Maximum number of iterations when executing recursive queries', '0', '4294967295', '1', NULL, 'NO', 'OPTIONAL', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('BINLOG_OPTIMIZE_THREAD_SCHEDULING', NULL, 'ON', 'COMPILE-TIME', 'ON', 'GLOBAL', 'BOOLEAN', 'Run fast part of group commit in a single thread, to optimize kernel thread scheduling. On by default. Disable to run each transaction in group commit in its own thread, which can be slower at very high concurrency. This option is mostly for testing one algorithm versus the other, and it should not normally be necessary to change it.', NULL, NULL, NULL, 'OFF,ON', 'YES', 'REQUIRED', NULL);
