INSERT INTO `SYSTEM_VARIABLES` VALUES ('ARIA_PAGECACHE_BUFFER_SIZE', NULL, '134217728', 'COMPILE-TIME', '134217728', 'GLOBAL', 'BIGINT UNSIGNED', 'The size of the buffer used for index blocks for Aria tables. Increase this to get better index handling (for all reads and multiple writes) to as much as you can afford.', '131072', '18446744073709551615', '1', NULL, 'YES', 'REQUIRED', NULL);
