INSERT INTO `SYSTEM_VARIABLES` VALUES ('EXPENSIVE_SUBQUERY_LIMIT', '100', '100', 'COMPILE-TIME', '100', 'SESSION', 'BIGINT UNSIGNED', 'The maximum number of rows a subquery may examine in order to be executed during optimization and used for constant optimization', '0', '18446744073709551615', '1', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('HAVE_SSL', NULL, 'DISABLED', 'COMPILE-TIME', NULL, 'GLOBAL', 'VARCHAR', 'If the server supports secure connections, will be set to YES, otherwise will be set to NO. If set to DISABLED, the server was compiled with TLS support, but was not started with TLS support (see the mysqld options). See also have_openssl.', NULL, NULL, NULL, NULL, 'YES', NULL, NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('INNODB_BUFFER_POOL_DUMP_AT_SHUTDOWN', NULL, 'ON', 'COMPILE-TIME', 'ON', 'GLOBAL', 'BOOLEAN', 'Dump the buffer pool into a file named @@innodb_buffer_pool_filename', NULL, NULL, NULL, 'OFF,ON', 'NO', 'REQUIRED', NULL);
