INSERT INTO `SYSTEM_VARIABLES` VALUES ('WSREP_NODE_ADDRESS', NULL, '', 'COMPILE-TIME', '', 'GLOBAL', 'VARCHAR', 'Specifies the node\'s network address, in the format ip address[:port]. Used in situations where autoguessing is not reliable. As of MariaDB 10.1.8, supports IPv6.', NULL, NULL, NULL, NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('DEADLOCK_SEARCH_DEPTH_LONG', '15', '15', 'COMPILE-TIME', '15', 'SESSION', 'INT UNSIGNED', 'Long search depth for the two-step deadlock detection', '0', '33', '1', NULL, 'NO', 'REQUIRED', NULL);
