INSERT INTO `SYSTEM_VARIABLES` VALUES ('MRR_BUFFER_SIZE', '262144', '262144', 'COMPILE-TIME', '262144', 'SESSION', 'INT UNSIGNED', 'Size of buffer to use when using MRR with range access', '8192', '2147483647', '1', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('SQL_LOG_BIN', 'ON', 'ON', 'COMPILE-TIME', 'ON', 'SESSION', 'BOOLEAN', 'If set to 0 (1 is the default), no logging to the binary log is done for the client. Only clients with the SUPER privilege can update this variable. Can have unintended consequences if set globally, see SET SQL_LOG_BIN. Starting MariaDB 10.1.7, this variable does not affect the replication of events in a Galera cluster.', NULL, NULL, NULL, 'OFF,ON', 'NO', NULL, NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('INNODB_MAX_DIRTY_PAGES_PCT_LWM', NULL, '0.000000', 'COMPILE-TIME', '0.000000', 'GLOBAL', 'DOUBLE', 'Percentage of dirty pages at which flushing kicks in. The value 0 (default) means \'refer to innodb_max_dirty_pages_pct\'.', '0', '99.999', NULL, NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('INNODB_STATS_ON_METADATA', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'Enable statistics gathering for metadata commands such as SHOW TABLE STATUS for tables that use transient statistics (off by default)', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('IDLE_WRITE_TRANSACTION_TIMEOUT', '0', '0', 'COMPILE-TIME', '0', 'SESSION', 'INT UNSIGNED', 'The number of seconds the server waits for write idle transaction', '0', '31536000', '1', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('SQL_NOTES', 'ON', 'ON', 'COMPILE-TIME', 'ON', 'SESSION', 'BOOLEAN', 'If set to 1, the default, warning_count is incremented each time a Note warning is encountered. If set to 0, Note warnings are not recorded. mysqldump has outputs to set this variable to 0 so that no unnecessary increments occur when data is reloaded. See also note_verbosity, which allows one to define with notes are sent.', NULL, NULL, NULL, 'OFF,ON', 'NO', NULL, NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('FOREIGN_KEY_CHECKS', 'ON', 'ON', 'COMPILE-TIME', 'ON', 'SESSION', 'BOOLEAN', 'If set to 1 (the default) foreign key constraints (including ON UPDATE and ON DELETE behavior) InnoDB tables are checked, while if set to 0, they are not checked. 0 is not recommended for normal use, though it can be useful in situations where you know the data is consistent, but want to reload data in a different order from that that specified by parent/child relationships. Setting this variable to 1 does not retrospectively check for inconsistencies introduced while set to 0.', NULL, NULL, NULL, 'OFF,ON', 'NO', NULL, NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('WSREP_MAX_WS_SIZE', NULL, '2147483647', 'COMPILE-TIME', '2147483647', 'GLOBAL', 'INT UNSIGNED', 'Max write set size (bytes)', '1024', '2147483647', '1', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('INNODB_MONITOR_RESET', NULL, '', 'COMPILE-TIME', '', 'GLOBAL', 'VARCHAR', 'Reset a monitor counter', NULL, NULL, NULL, NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('GTID_SEQ_NO', '0', NULL, 'COMPILE-TIME', '0', 'SESSION ONLY', 'BIGINT UNSIGNED', 'Internal server usage, for replication with global transaction id. When set, next event group logged to the binary log will use this sequence number, not generate a new one, thus allowing to preserve master\'s GTID in slave\'s binlog.', '0', '18446744073709551615', '1', NULL, 'NO', NULL, NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('INNODB_STATS_AUTO_RECALC', NULL, 'ON', 'COMPILE-TIME', 'ON', 'GLOBAL', 'BOOLEAN', 'InnoDB automatic recalculation of persistent statistics enabled for all tables unless overridden at table level (automatic recalculation is only done when InnoDB decides that the table has changed too much and needs a new statistics)', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('SQL_BUFFER_RESULT', 'OFF', 'OFF', 'COMPILE-TIME', 'OFF', 'SESSION', 'BOOLEAN', 'If set to 1 (0 is default), results from SELECT statements are always placed into temporary tables. This can help the server when it takes a long time to send the results to the client by allowing the table locks to be freed early.', NULL, NULL, NULL, 'OFF,ON', 'NO', NULL, NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('INNODB_DEFRAGMENT', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'Enable/disable InnoDB defragmentation (default FALSE). When set to FALSE, all existing defragmentation will be paused. And new defragmentation command will fail.Paused defragmentation commands will resume when this variable is set to true again.', NULL, NULL, NULL, 'OFF,ON', 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('PERFORMANCE_SCHEMA_MAX_DIGEST_LENGTH', NULL, '1024', 'COMPILE-TIME', '1024', 'GLOBAL', 'INT', 'Maximum length considered for digest text, when stored in performance_schema tables.', '0', '1048576', '1', NULL, 'YES', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('MAX_TMP_TABLES', '32', '32', 'COMPILE-TIME', '32', 'SESSION', 'INT UNSIGNED', 'Unused, will be removed.', '1', '4294967295', '1', NULL, 'NO', 'REQUIRED', NULL);
