INSERT INTO `SYSTEM_VARIABLES` VALUES ('PERFORMANCE_SCHEMA_MAX_FILE_HANDLES', NULL, '32768', 'COMPILE-TIME', '32768', 'GLOBAL', 'INT UNSIGNED', 'Maximum number of opened instrumented files.', '0', '1048576', '1', NULL, 'YES', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('MYISAM_REPAIR_THREADS', '1', '1', 'COMPILE-TIME', '1', 'SESSION', 'INT UNSIGNED', 'If larger than 1, when repairing a MyISAM table all indexes will be created in parallel, with one thread per index. The value of 1 disables parallel repair', '1', '4294967295', '1', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('ENCRYPT_TMP_DISK_TABLES', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'Encrypt temporary on-disk tables (created as part of query execution)', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('SKIP_REPLICATION', 'OFF', NULL, 'COMPILE-TIME', 'OFF', 'SESSION ONLY', 'BOOLEAN', 'Changes are logged into the binary log with the @@skip_replication flag set. Such events will not be replicated by slaves that run with --replicate-events-marked-for-skip set different from its default of REPLICATE. See Selectively skipping replication of binlog events for more information.', NULL, NULL, NULL, 'OFF,ON', 'NO', NULL, NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('UNIQUE_CHECKS', 'ON', 'ON', 'COMPILE-TIME', 'ON', 'SESSION', 'BOOLEAN', 'If set to 1, the default, secondary indexes in InnoDB tables are performed. If set to 0, storage engines can (but are not required to) assume that duplicate keys are not present in input data. Set to 0 to speed up imports of large tables to InnoDB. The storage engine will still issue a duplicate key error if it detects one, even if set to 0.', NULL, NULL, NULL, 'OFF,ON', 'NO', NULL, NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('WSREP_SLAVE_UK_CHECKS', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'Should slave thread do secondary index uniqueness checks', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('GENERAL_LOG_FILE', NULL, '.log', 'COMPILE-TIME', '', 'GLOBAL', 'VARCHAR', 'Log connections and queries to given file', NULL, NULL, NULL, NULL, 'NO', 'REQUIRED', NULL);
