INSERT INTO `SYSTEM_VARIABLES` VALUES ('HAVE_RTREE_KEYS', NULL, 'YES', 'COMPILE-TIME', NULL, 'GLOBAL', 'VARCHAR', 'If RTREE indexes (used for spatial indexes) are available, will be set to YES, otherwise will be set to NO.', NULL, NULL, NULL, NULL, 'YES', NULL, NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('SESSION_TRACK_SYSTEM_VARIABLES', 'autocommit,character_set_client,character_set_connection,character_set_results,time_zone', 'autocommit,character_set_client,character_set_connection,character_set_results,time_zone', 'COMPILE-TIME', 'autocommit,character_set_client,character_set_connection,character_set_results,time_zone', 'SESSION', 'VARCHAR', 'Track changes in registered system variables. ', NULL, NULL, NULL, NULL, 'NO', 'REQUIRED', NULL);
