INSERT INTO `SYSTEM_VARIABLES` VALUES ('UPDATABLE_VIEWS_WITH_LIMIT', 'YES', 'YES', 'COMPILE-TIME', 'YES', 'SESSION', 'ENUM', 'YES = Don\'t issue an error message (warning only) if a VIEW without presence of a key of the underlying table is used in queries with a LIMIT clause for updating. NO = Prohibit update of a VIEW, which does not contain a key of the underlying table and the query uses a LIMIT clause (usually get from GUI tools)', NULL, NULL, NULL, 'NO,YES', 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('WSREP_SST_RECEIVE_ADDRESS', NULL, 'AUTO', 'COMPILE-TIME', 'AUTO', 'GLOBAL', 'VARCHAR', 'Address where node is waiting for SST contact', NULL, NULL, NULL, NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('SLAVE_TYPE_CONVERSIONS', NULL, '', 'COMPILE-TIME', '', 'GLOBAL', 'SET', 'Set of slave type conversions that are enabled. If the variable is empty, no conversions are allowed and it is expected that the types match exactly', NULL, NULL, NULL, 'ALL_LOSSY,ALL_NON_LOSSY', 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('MAX_CONNECT_ERRORS', NULL, '100', 'COMPILE-TIME', '100', 'GLOBAL', 'INT UNSIGNED', 'If there is more than this number of interrupted connections from a host this host will be blocked from further connections', '1', '4294967295', '1', NULL, 'NO', 'REQUIRED', NULL);
