INSERT INTO `SYSTEM_VARIABLES` VALUES ('WSREP_STRICT_DDL', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'If set, reject DDL on affected tables not supporting Galera replication', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL', NULL);
