INSERT INTO `SYSTEM_VARIABLES` VALUES ('SLAVE_TRANSACTION_RETRY_INTERVAL', NULL, '0', 'COMPILE-TIME', '0', 'GLOBAL', 'INT UNSIGNED', 'Interval of the slave SQL thread will retry a transaction in case it failed with a deadlock or elapsed lock wait timeout or listed in slave_transaction_retry_errors', '0', '3600', '1', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('SQL_QUOTE_SHOW_CREATE', 'ON', 'ON', 'COMPILE-TIME', 'ON', 'SESSION', 'BOOLEAN', 'If set to 1, the default, the server will quote identifiers for SHOW CREATE DATABASE, SHOW CREATE TABLE and SHOW CREATE VIEW statements. Quoting is disabled if set to 0. Enable to ensure replications works when identifiers require quoting.', NULL, NULL, NULL, 'OFF,ON', 'NO', NULL, NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('SQL_LOG_OFF', 'OFF', 'OFF', 'COMPILE-TIME', 'OFF', 'SESSION', 'BOOLEAN', 'If set to 1 (0 is the default), no logging to the general query log is done for the client. Only clients with the SUPER privilege can update this variable.', NULL, NULL, NULL, 'OFF,ON', 'NO', NULL, NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('WSREP_MODE', NULL, '', 'COMPILE-TIME', '', 'GLOBAL', 'SET', 'Set of WSREP features that are enabled.', NULL, NULL, NULL, 'STRICT_REPLICATION,BINLOG_ROW_FORMAT_ONLY,REQUIRED_PRIMARY_KEY,REPLICATE_MYISAM,REPLICATE_ARIA,DISALLOW_LOCAL_GTID,BF_ABORT_MARIABACKUP', 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('INNODB_BUFFER_POOL_CHUNK_SIZE', NULL, '134217728', 'COMPILE-TIME', '134217728', 'GLOBAL', 'INT UNSIGNED', 'Size of a single memory chunk for resizing buffer pool. Online buffer pool resizing happens at this granularity. 0 means disable resizing buffer pool.', '1048576', '2147483647', '1048576', NULL, 'YES', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('WSREP_CERTIFICATION_RULES', NULL, 'strict', 'COMPILE-TIME', 'strict', 'GLOBAL', 'ENUM', 'Certification rules to use in the cluster. Possible values are: \"strict\": stricter rules that could result in more certification failures. \"optimized\": relaxed rules that allow more concurrency and cause less certification failures.', NULL, NULL, NULL, 'strict,optimized', 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('SLOW_QUERY_LOG_FILE', NULL, '-slow.log', 'COMPILE-TIME', '', 'GLOBAL', 'VARCHAR', 'Log slow queries to given log file. Defaults logging to \'hostname\'-slow.log. Must be enabled to activate other slow log options', NULL, NULL, NULL, NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('PERFORMANCE_SCHEMA_MAX_TABLE_HANDLES', NULL, '-1', 'COMPILE-TIME', '-1', 'GLOBAL', 'INT', 'Maximum number of opened instrumented tables. Use 0 to disable, -1 for automated sizing.', '-1', '1048576', '1', NULL, 'YES', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('AUTO_INCREMENT_INCREMENT', '1', '1', 'COMPILE-TIME', '1', 'SESSION', 'INT UNSIGNED', 'Auto-increment columns are incremented by this', '1', '65535', '1', NULL, 'NO', 'OPTIONAL', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('SLAVE_SQL_VERIFY_CHECKSUM', NULL, 'ON', 'COMPILE-TIME', 'ON', 'GLOBAL', 'BOOLEAN', 'Force checksum verification of replication events after reading them from relay log. Note: Events are always checksum-verified by slave on receiving them from the network before writing them to the relay log', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('RPL_SEMI_SYNC_MASTER_TRACE_LEVEL', NULL, '32', 'COMPILE-TIME', '32', 'GLOBAL', 'INT UNSIGNED', 'The tracing level for semi-sync replication.', '0', '4294967295', '1', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('WARNING_COUNT', '0', NULL, 'COMPILE-TIME', NULL, 'SESSION ONLY', 'BIGINT UNSIGNED', 'The number of errors, warnings, and notes that resulted from the last statement that generated messages', '0', '18446744073709551615', '1', NULL, 'YES', NULL, NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('MYISAM_STATS_METHOD', 'NULLS_UNEQUAL', 'NULLS_UNEQUAL', 'COMPILE-TIME', 'NULLS_UNEQUAL', 'SESSION', 'ENUM', 'Specifies how MyISAM index statistics collection code should treat NULLs. Possible values of name are NULLS_UNEQUAL (default behavior for 4.1 and later), NULLS_EQUAL (emulate 4.0 behavior), and NULLS_IGNORED', NULL, NULL, NULL, 'NULLS_UNEQUAL,NULLS_EQUAL,NULLS_IGNORED', 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('MYISAM_SORT_BUFFER_SIZE', '134216704', '134216704', 'COMPILE-TIME', '134216704', 'SESSION', 'BIGINT UNSIGNED', 'The buffer that is allocated when sorting the index when doing a REPAIR or when creating indexes with CREATE INDEX or ALTER TABLE', '4096', '268435455', '1', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('INNODB_COMPRESSION_LEVEL', NULL, '6', 'COMPILE-TIME', '6', 'GLOBAL', 'INT UNSIGNED', 'Compression level used for zlib compression.  0 is no compression, 1 is fastest, 9 is best compression and default is 6.', '0', '9', '0', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('INNODB_OLD_BLOCKS_PCT', NULL, '37', 'COMPILE-TIME', '37', 'GLOBAL', 'INT UNSIGNED', 'Percentage of the buffer pool to reserve for \'old\' blocks.', '5', '95', '0', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('CHARACTER_SETS_DIR', NULL, '/usr/local/share/mysql/charsets/', 'AUTO', '', 'GLOBAL', 'VARCHAR', 'Directory where character sets are', NULL, NULL, NULL, NULL, 'YES', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('ERROR_COUNT', '0', NULL, 'COMPILE-TIME', NULL, 'SESSION ONLY', 'BIGINT UNSIGNED', 'The number of errors that resulted from the last statement that generated messages', '0', '18446744073709551615', '1', NULL, 'YES', NULL, NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('MAX_ERROR_COUNT', '64', '64', 'COMPILE-TIME', '64', 'SESSION', 'INT UNSIGNED', 'Max number of errors/warnings to store for a statement', '0', '65535', '1', NULL, 'NO', 'REQUIRED', NULL);
