INSERT INTO `SYSTEM_VARIABLES` VALUES ('FT_MIN_WORD_LEN', NULL, '4', 'COMPILE-TIME', '4', 'GLOBAL', 'INT UNSIGNED', 'The minimum length of the word to be included in a FULLTEXT index. Note: FULLTEXT indexes must be rebuilt after changing this variable', '1', '84', '1', NULL, 'YES', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('SLAVE_PARALLEL_MODE', NULL, 'optimistic', 'COMPILE-TIME', 'optimistic', 'GLOBAL', 'ENUM', 'Controls what transactions are applied in parallel when using --slave-parallel-threads. Possible values: \"optimistic\" tries to apply most transactional DML in parallel, and handles any conflicts with rollback and retry. \"conservative\" limits parallelism in an effort to avoid any conflicts. \"aggressive\" tries to maximise the parallelism, possibly at the cost of increased conflict rate. \"minimal\" only parallelizes the commit steps of transactions. \"none\" disables parallel apply completely.', NULL, NULL, NULL, 'none,minimal,conservative,optimistic,aggressive', 'NO', NULL, NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('WSREP_FORCED_BINLOG_FORMAT', NULL, 'NONE', 'COMPILE-TIME', 'NONE', 'GLOBAL', 'ENUM', 'binlog format to take effect over user\'s choice', NULL, NULL, NULL, 'MIXED,STATEMENT,ROW,NONE', 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('SKIP_SHOW_DATABASE', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'Don\'t allow \'SHOW DATABASE\' commands', NULL, NULL, NULL, 'OFF,ON', 'YES', 'OPTIONAL', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('BINLOG_EXPIRE_LOGS_SECONDS', NULL, '0', 'COMPILE-TIME', '0', 'GLOBAL', 'INT UNSIGNED', 'If non-zero, binary logs will be purged after binlog_expire_logs_seconds seconds; It and expire_logs_days are linked, such that changes in one are converted into the other. Possible purges happen at startup and at binary log rotation.', '0', '8553600', '1', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('AUTOCOMMIT', 'ON', 'ON', 'COMPILE-TIME', 'ON', 'SESSION', 'BOOLEAN', 'If set to 1, the default, all queries are committed immediately. If set to 0, they are only committed upon a COMMIT statement, or rolled back with a ROLLBACK statement. If autocommit is set to 0, and then changed to 1, all open transactions are immediately committed.', NULL, NULL, NULL, 'OFF,ON', 'NO', NULL, NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('MYISAM_MMAP_SIZE', NULL, '4294967295', 'COMPILE-TIME', '4294967295', 'GLOBAL', 'BIGINT UNSIGNED', 'Restricts the total memory used for memory mapping of MySQL tables', '7', '4294967295', '1', NULL, 'YES', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('EQ_RANGE_INDEX_DIVE_LIMIT', '200', '200', 'COMPILE-TIME', '200', 'SESSION', 'INT UNSIGNED', 'The optimizer will use existing index statistics instead of doing index dives for equality ranges if the number of equality ranges for the index is larger than or equal to this number. If set to 0, index dives are always used.', '0', '4294967295', '1', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('KEY_CACHE_BLOCK_SIZE', NULL, '1024', 'COMPILE-TIME', '1024', 'GLOBAL', 'BIGINT UNSIGNED', 'The default size of key cache blocks', '512', '16384', '512', NULL, 'NO', 'REQUIRED', NULL);
