INSERT INTO `SYSTEM_VARIABLES` VALUES ('WSREP_CERTIFY_NONPK', NULL, 'ON', 'COMPILE-TIME', 'ON', 'GLOBAL', 'BOOLEAN', 'Certify tables with no primary key', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('RPL_SEMI_SYNC_SLAVE_ENABLED', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'Enable semi-synchronous replication slave (disabled by default).', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL', NULL);
