INSERT INTO `SYSTEM_VARIABLES` VALUES ('MYISAM_USE_MMAP', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'Use memory mapping for reading and writing MyISAM tables', NULL, NULL, NULL, 'OFF,ON', 'NO', 'NONE', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('VERSION_COMPILE_OS', NULL, 'FreeBSD13.2', 'COMPILE-TIME', NULL, 'GLOBAL', 'VARCHAR', 'Operating system that MariaDB was built on, for example debian-linux-gnu.', NULL, NULL, NULL, NULL, 'YES', NULL, NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('INNODB_BUFFER_POOL_LOAD_AT_STARTUP', NULL, 'ON', 'COMPILE-TIME', 'ON', 'GLOBAL', 'BOOLEAN', 'Load the buffer pool from a file named @@innodb_buffer_pool_filename', NULL, NULL, NULL, 'OFF,ON', 'YES', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('INNODB_FT_CACHE_SIZE', NULL, '8000000', 'COMPILE-TIME', '8000000', 'GLOBAL', 'INT UNSIGNED', 'InnoDB Fulltext search cache size in bytes', '1600000', '536870912', '0', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('VERSION', NULL, '10.6.16-MariaDB', 'COMPILE-TIME', NULL, 'GLOBAL', 'VARCHAR', 'Server version number. It may also include a suffix with configuration or build information. -debug indicates debugging support was enabled on the server, and -log indicates at least one of the binary log, general log or slow query log are enabled, for example 10.1.1-MariaDB-mariadb1precise-log.', NULL, NULL, NULL, NULL, 'YES', NULL, NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('OPTIMIZER_MAX_SEL_ARG_WEIGHT', '32000', '32000', 'COMPILE-TIME', '32000', 'SESSION', 'INT UNSIGNED', 'The maximum weight of the SEL_ARG graph. Set to 0 for no limit', '0', '4294967295', '1', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('INTERACTIVE_TIMEOUT', '28800', '28800', 'COMPILE-TIME', '28800', 'SESSION', 'INT UNSIGNED', 'The number of seconds the server waits for activity on an interactive connection before closing it', '1', '31536000', '1', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('SQL_SAFE_UPDATES', 'OFF', 'OFF', 'COMPILE-TIME', 'OFF', 'SESSION', 'BOOLEAN', 'If set to 1, UPDATEs and DELETEs need either a key in the WHERE clause, or a LIMIT clause, or else they will aborted. Prevents the common mistake of accidentally deleting or updating every row in a table.', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('LOG_SLAVE_UPDATES', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'Tells the slave to log the updates from the slave thread to the binary log. You will need to turn it on if you plan to daisy-chain the slaves.', NULL, NULL, NULL, 'OFF,ON', 'YES', 'OPTIONAL', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('IDLE_READONLY_TRANSACTION_TIMEOUT', '0', '0', 'COMPILE-TIME', '0', 'SESSION', 'INT UNSIGNED', 'The number of seconds the server waits for read-only idle transaction', '0', '31536000', '1', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('DEADLOCK_TIMEOUT_LONG', '50000000', '50000000', 'COMPILE-TIME', '50000000', 'SESSION', 'INT UNSIGNED', 'Long timeout for the two-step deadlock detection (in microseconds)', '0', '4294967295', '1', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('REPLICATE_EVENTS_MARKED_FOR_SKIP', NULL, 'REPLICATE', 'COMPILE-TIME', 'REPLICATE', 'GLOBAL', 'ENUM', 'Whether the slave should replicate events that were created with @@skip_replication=1 on the master. Default REPLICATE (no events are skipped). Other values are FILTER_ON_SLAVE (events will be sent by the master but ignored by the slave) and FILTER_ON_MASTER (events marked with @@skip_replication=1 will be filtered on the master and never be sent to the slave).', NULL, NULL, NULL, 'REPLICATE,FILTER_ON_SLAVE,FILTER_ON_MASTER', 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('INNODB_DEFRAGMENT_N_PAGES', NULL, '7', 'COMPILE-TIME', '7', 'GLOBAL', 'INT UNSIGNED', 'Number of pages considered at once when merging multiple pages to defragment', '2', '32', '0', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('INNODB_OPEN_FILES', NULL, '2000', 'COMPILE-TIME', '0', 'GLOBAL', 'INT UNSIGNED', 'How many files at the maximum InnoDB keeps open at the same time.', '0', '2147483647', '0', NULL, 'YES', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('DEBUG_NO_THREAD_ALARM', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'Disable system thread alarm calls. Disabling it may be useful in debugging or testing, never do it in production', NULL, NULL, NULL, 'OFF,ON', 'YES', 'OPTIONAL', NULL);
