INSERT INTO `SYSTEM_VARIABLES` VALUES ('SKIP_NAME_RESOLVE', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'Don\'t resolve hostnames. All hostnames are IP\'s or \'localhost\'.', NULL, NULL, NULL, 'OFF,ON', 'YES', 'OPTIONAL', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('INNODB_DEADLOCK_DETECT', NULL, 'ON', 'COMPILE-TIME', 'ON', 'GLOBAL', 'BOOLEAN', 'Enable/disable InnoDB deadlock detector (default ON). if set to OFF, deadlock detection is skipped, and we rely on innodb_lock_wait_timeout in case of deadlock.', NULL, NULL, NULL, 'OFF,ON', 'NO', 'NONE', NULL);
