INSERT INTO `SYSTEM_VARIABLES` VALUES ('READ_BINLOG_SPEED_LIMIT', NULL, '0', 'COMPILE-TIME', '0', 'GLOBAL', 'BIGINT UNSIGNED', 'Maximum speed(KB/s) to read binlog from master (0 = no limit)', '0', '4294967295', '1', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('INNODB_FT_SERVER_STOPWORD_TABLE', NULL, '', 'COMPILE-TIME', '', 'GLOBAL', 'VARCHAR', 'The user supplied stopword table name.', NULL, NULL, NULL, NULL, 'NO', 'OPTIONAL', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('SLAVE_DOMAIN_PARALLEL_THREADS', NULL, '0', 'COMPILE-TIME', '0', 'GLOBAL', 'INT UNSIGNED', 'Maximum number of parallel threads to use on slave for events in a single replication domain. When using multiple domains, this can be used to limit a single domain from grabbing all threads and thus stalling other domains. The default of 0 means to allow a domain to grab as many threads as it wants, up to the value of slave_parallel_threads.', '0', '16383', '1', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('IN_PREDICATE_CONVERSION_THRESHOLD', '1000', '1000', 'COMPILE-TIME', '1000', 'SESSION', 'INT UNSIGNED', 'The minimum number of scalar elements in the value list of IN predicate that triggers its conversion to IN subquery. Set to 0 to disable the conversion.', '0', '4294967295', '1', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('ENFORCE_STORAGE_ENGINE', '', '', 'COMPILE-TIME', NULL, 'SESSION', 'VARCHAR', 'Force the use of a storage engine for new tables', NULL, NULL, NULL, NULL, 'NO', NULL, NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('INNODB_DEFRAGMENT_FILL_FACTOR', NULL, '0.900000', 'COMPILE-TIME', '0.900000', 'GLOBAL', 'DOUBLE', 'A number between [0.7, 1] that tells defragmentation how full it should fill a page. Default is 0.9. Number below 0.7 won\'t make much sense.This variable, together with innodb_defragment_fill_factor_n_recs, is introduced so defragmentation won\'t pack the page too full and cause page split on the next insert on every page. The variable indicating more defragmentation gain is the one effective.', '0.7', '1', NULL, NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('INNODB_FT_ENABLE_DIAG_PRINT', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'Whether to enable additional FTS diagnostic printout ', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('BASEDIR', NULL, '/usr/local', 'COMMAND-LINE', '', 'GLOBAL', 'VARCHAR', 'Path to installation directory. All paths are usually resolved relative to this', NULL, NULL, NULL, NULL, 'YES', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('HAVE_SYMLINK', NULL, 'YES', 'COMPILE-TIME', NULL, 'GLOBAL', 'VARCHAR', 'If symbolic link support is enabled, will be set to YES, otherwise will be set to NO. Required for the INDEX DIRECTORY and DATA DIRECTORY table options (see CREATE TABLE) and Windows symlink support. Will be set to DISABLED if the server is started with the --skip-symbolic-links option.', NULL, NULL, NULL, NULL, 'YES', NULL, NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('IDENTITY', '0', NULL, 'COMPILE-TIME', '0', 'SESSION ONLY', 'BIGINT UNSIGNED', 'Synonym for the last_insert_id variable', '0', '18446744073709551615', '1', NULL, 'NO', NULL, NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('INNODB_LOG_FILE_SIZE', NULL, '100663296', 'COMPILE-TIME', '100663296', 'GLOBAL', 'BIGINT UNSIGNED', 'Size of each log file in a log group.', '1048576', '18446744073709551615', '65536', NULL, 'YES', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('SSL_KEY', NULL, '', 'COMPILE-TIME', '', 'GLOBAL', 'VARCHAR', 'X509 key in PEM format (implies --ssl)', NULL, NULL, NULL, NULL, 'YES', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('INNODB_FLUSH_NEIGHBORS', NULL, '1', 'COMPILE-TIME', '1', 'GLOBAL', 'INT UNSIGNED', 'Set to 0 (don\'t flush neighbors from buffer pool), 1 (flush contiguous neighbors from buffer pool) or 2 (flush neighbors from buffer pool), when flushing a block', '0', '2', '0', NULL, 'NO', 'OPTIONAL', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('WSREP_MAX_WS_ROWS', NULL, '0', 'COMPILE-TIME', '0', 'GLOBAL', 'INT UNSIGNED', 'Max number of rows in write set', '0', '1048576', '1', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('SECURE_TIMESTAMP', NULL, 'NO', 'COMPILE-TIME', 'NO', 'GLOBAL', 'ENUM', 'Restricts direct setting of a session timestamp. Possible levels are: YES - timestamp cannot deviate from the system clock, REPLICATION - replication thread can adjust timestamp to match the master\'s, SUPER - a user with this privilege and a replication thread can adjust timestamp, NO - historical behavior, anyone can modify session timestamp', NULL, NULL, NULL, 'NO,SUPER,REPLICATION,YES', 'YES', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('SLAVE_DDL_EXEC_MODE', NULL, 'IDEMPOTENT', 'COMPILE-TIME', 'IDEMPOTENT', 'GLOBAL', 'ENUM', 'How replication events should be executed. Legal values are STRICT and IDEMPOTENT (default). In IDEMPOTENT mode, replication will not stop for DDL operations that are idempotent. This means that CREATE TABLE is treated as CREATE TABLE OR REPLACE and DROP TABLE is treated as DROP TABLE IF EXISTS.', NULL, NULL, NULL, 'STRICT,IDEMPOTENT', 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('INNODB_FT_AUX_TABLE', NULL, '', 'COMPILE-TIME', '', 'GLOBAL', 'VARCHAR', 'FTS internal auxiliary table to be checked', NULL, NULL, NULL, NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('ARIA_PAGECACHE_FILE_HASH_SIZE', NULL, '512', 'COMPILE-TIME', '512', 'GLOBAL', 'INT UNSIGNED', 'Number of hash buckets for open and changed files.  If you have a lot of Aria files open you should increase this for faster flush of changes. A good value is probably 1/10 of number of possible open Aria files.', '128', '16384', '1', NULL, 'YES', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('INNODB_LOG_WRITE_AHEAD_SIZE', NULL, '8192', 'COMPILE-TIME', '8192', 'GLOBAL', 'INT UNSIGNED', 'Redo log write ahead unit size to avoid read-on-write, it should match the OS cache block IO size', '512', '16384', '512', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('MAX_WRITE_LOCK_COUNT', NULL, '4294967295', 'COMPILE-TIME', '4294967295', 'GLOBAL', 'INT UNSIGNED', 'After this many write locks, allow some read locks to run in between', '1', '4294967295', '1', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('WSREP_RECOVER', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'Recover database state after crash and exit', NULL, NULL, NULL, 'OFF,ON', 'YES', 'OPTIONAL', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('REPLICATE_IGNORE_TABLE', NULL, '', 'COMPILE-TIME', '', 'GLOBAL', 'VARCHAR', 'Tells the slave thread not to replicate any statement that updates the specified table, even if any other tables might be updated by the same statement.', NULL, NULL, NULL, NULL, 'NO', NULL, NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('GTID_CLEANUP_BATCH_SIZE', NULL, '64', 'COMPILE-TIME', '64', 'GLOBAL', 'INT UNSIGNED', 'Normally does not need tuning. How many old rows must accumulate in the mysql.gtid_slave_pos table before a background job will be run to delete them. Can be increased to reduce number of commits if using many different engines with --gtid_pos_auto_engines, or to reduce CPU overhead if using a huge number of different gtid_domain_ids. Can be decreased to reduce number of old rows in the table.', '0', '2147483647', '1', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('INNODB_LOG_GROUP_HOME_DIR', NULL, './', 'COMPILE-TIME', '', 'GLOBAL', 'VARCHAR', 'Path to InnoDB log files.', NULL, NULL, NULL, NULL, 'YES', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('TIMESTAMP', '1717603873.396620', NULL, 'COMPILE-TIME', '0.000000', 'SESSION ONLY', 'DOUBLE', 'Set the time for this client', '0', '2147483647', NULL, NULL, 'NO', NULL, NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('INNODB_CHECKSUM_ALGORITHM', NULL, 'full_crc32', 'COMPILE-TIME', 'full_crc32', 'GLOBAL', 'ENUM', 'The algorithm InnoDB uses for page checksumming. Possible values are FULL_CRC32 for new files, always use CRC-32C; for old, see CRC32 below; STRICT_FULL_CRC32 for new files, always use CRC-32C; for old, see STRICT_CRC32 below; CRC32 write crc32, allow previously used algorithms to match when reading; STRICT_CRC32 write crc32, do not allow other algorithms to match when reading; New files created with full_crc32 are readable by MariaDB 10.4.3+', NULL, NULL, NULL, 'crc32,strict_crc32,full_crc32,strict_full_crc32', 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('MAX_SEEKS_FOR_KEY', '4294967295', '4294967295', 'COMPILE-TIME', '4294967295', 'SESSION', 'INT UNSIGNED', 'Limit assumed max number of seeks when looking up rows based on a key', '1', '4294967295', '1', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('ARIA_LOG_PURGE_TYPE', NULL, 'immediate', 'COMPILE-TIME', 'immediate', 'GLOBAL', 'ENUM', 'Specifies how Aria transactional log will be purged', NULL, NULL, NULL, 'immediate,external,at_flush', 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('KEY_CACHE_SEGMENTS', NULL, '0', 'COMPILE-TIME', '0', 'GLOBAL', 'BIGINT UNSIGNED', 'The number of segments in a key cache', '0', '64', '1', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('MYSQL56_TEMPORAL_FORMAT', NULL, 'ON', 'COMPILE-TIME', 'ON', 'GLOBAL', 'BOOLEAN', 'Use MySQL-5.6 (instead of MariaDB-5.3) format for TIME, DATETIME, TIMESTAMP columns.', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('QUERY_CACHE_MIN_RES_UNIT', NULL, '4096', 'COMPILE-TIME', '4096', 'GLOBAL', 'INT UNSIGNED', 'The minimum size for blocks allocated by the query cache', '0', '4294967295', '8', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('THREAD_POOL_EXACT_STATS', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'If set to 1, provides better statistics in information_schema threadpool tables', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('WSREP_SR_STORE', NULL, 'table', 'COMPILE-TIME', 'table', 'GLOBAL', 'ENUM', 'Storage for streaming replication fragments', NULL, NULL, NULL, 'none,table', 'YES', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('DEADLOCK_TIMEOUT_SHORT', '10000', '10000', 'COMPILE-TIME', '10000', 'SESSION', 'INT UNSIGNED', 'Short timeout for the two-step deadlock detection (in microseconds)', '0', '4294967295', '1', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('ROWID_MERGE_BUFF_SIZE', '8388608', '8388608', 'COMPILE-TIME', '8388608', 'SESSION', 'INT UNSIGNED', 'The size of the buffers used [NOT] IN evaluation via partial matching', '0', '2147483647', '1', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('WSREP_DESYNC', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'To desynchronize the node from the cluster', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('ARIA_GROUP_COMMIT', NULL, 'none', 'COMPILE-TIME', 'none', 'GLOBAL', 'ENUM', 'Specifies Aria group commit mode. Possible values are \"none\" (no group commit), \"hard\" (with waiting to actual commit), \"soft\" (no wait for commit (DANGEROUS!!!))', NULL, NULL, NULL, 'none,hard,soft', 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('SESSION_TRACK_STATE_CHANGE', 'OFF', 'OFF', 'COMPILE-TIME', 'OFF', 'SESSION', 'BOOLEAN', 'Track changes to the session state.', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('LARGE_PAGE_SIZE', NULL, '0', 'COMPILE-TIME', NULL, 'GLOBAL', 'INT UNSIGNED', 'Previously showed the size of large memory pages, unused since multiple page size support was added', '0', '4294967295', '1', NULL, 'YES', NULL, NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('TIME_ZONE', 'SYSTEM', 'SYSTEM', 'COMPILE-TIME', 'SYSTEM', 'SESSION', 'VARCHAR', 'The current time zone, used to initialize the time zone for a client when it connects. Set to SYSTEM by default, in which the client uses the system time zone value.', NULL, NULL, NULL, NULL, 'NO', NULL, NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('READ_RND_BUFFER_SIZE', '262144', '262144', 'COMPILE-TIME', '262144', 'SESSION', 'INT UNSIGNED', 'When reading rows in sorted order after a sort, the rows are read through this buffer to avoid a disk seeks', '1', '2147483647', '1', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('INNODB_VERSION', NULL, '10.6.16', 'COMPILE-TIME', NULL, 'GLOBAL', 'VARCHAR', 'InnoDB version', NULL, NULL, NULL, NULL, 'YES', NULL, NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('IN_TRANSACTION', '0', NULL, 'COMPILE-TIME', NULL, 'SESSION ONLY', 'BIGINT UNSIGNED', 'Whether there is an active transaction', '0', '1', '1', NULL, 'YES', NULL, NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('INNODB_TABLE_LOCKS', 'ON', 'ON', 'COMPILE-TIME', 'ON', 'SESSION', 'BOOLEAN', 'Enable InnoDB locking in LOCK TABLES', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('ARIA_LOG_FILE_SIZE', NULL, '1073741824', 'COMPILE-TIME', '1073741824', 'GLOBAL', 'INT UNSIGNED', 'Limit for transaction log size', '8388608', '4294967295', '8192', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('INNODB_FORCE_PRIMARY_KEY', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'Do not allow creating a table without primary key (off by default)', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('OPTIMIZER_SEARCH_DEPTH', '62', '62', 'COMPILE-TIME', '62', 'SESSION', 'INT UNSIGNED', 'Maximum depth of search performed by the query optimizer. Values larger than the number of relations in a query result in better query plans, but take longer to compile a query. Values smaller than the number of tables in a relation result in faster optimization, but may produce very bad query plans. If set to 0, the system will automatically pick a reasonable value.', '0', '62', '1', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('RELAY_LOG_PURGE', NULL, 'ON', 'COMPILE-TIME', 'ON', 'GLOBAL', 'BOOLEAN', 'if disabled - do not purge relay logs. if enabled - purge them as soon as they are no more needed.', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('TCP_KEEPALIVE_TIME', NULL, '0', 'COMPILE-TIME', '0', 'GLOBAL', 'INT', 'Timeout, in seconds, with no activity until the first TCP keep-alive packet is sent.If set to 0, system dependent default is used.', '0', '2147483', '1', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('INNODB_FT_TOTAL_CACHE_SIZE', NULL, '640000000', 'COMPILE-TIME', '640000000', 'GLOBAL', 'INT UNSIGNED', 'Total memory allocated for InnoDB Fulltext Search cache', '32000000', '1600000000', '0', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('READ_ONLY', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'Make all non-temporary tables read-only, with the exception for replication (slave) threads and users with the SUPER privilege', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('OPTIMIZER_MAX_SEL_ARGS', '16000', '16000', 'COMPILE-TIME', '16000', 'SESSION', 'INT UNSIGNED', 'The maximum number of SEL_ARG objects created when optimizing a range. If more objects would be needed, the range will not be used by the optimizer.', '0', '4294967295', '1', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('INNODB_FAST_SHUTDOWN', NULL, '1', 'COMPILE-TIME', '1', 'GLOBAL', 'INT UNSIGNED', 'Speeds up the shutdown process of the InnoDB storage engine. Possible values are 0, 1 (faster), 2 (crash-like), 3 (fastest clean).', '0', '3', '0', NULL, 'NO', 'OPTIONAL', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('IDLE_TRANSACTION_TIMEOUT', '0', '0', 'COMPILE-TIME', '0', 'SESSION', 'INT UNSIGNED', 'The number of seconds the server waits for idle transaction', '0', '31536000', '1', NULL, 'NO', 'REQUIRED', NULL);
INSERT INTO `SYSTEM_VARIABLES` VALUES ('INNODB_DATA_FILE_PATH', NULL, 'ibdata1:12M:autoextend', 'COMPILE-TIME', 'ibdata1:12M:autoextend', 'GLOBAL', 'VARCHAR', 'Path to individual files and their sizes.', NULL, NULL, NULL, NULL, 'YES', 'REQUIRED', NULL);
