INSERT INTO `TRIGGERS` VALUES ('def', 'mall', 'update_trigger_mall_category', 'UPDATE', 'def', 'mall', 'mall_category', 1, NULL, 'BEGIN    \r\nDECLARE done INT DEFAULT FALSE;\r\n    DECLARE ids INT;\r\n    DECLARE cur CURSOR FOR SELECT mall_id FROM mall_category_connection WHERE category_id = NEW.id;\r\n    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;\r\n\r\n    OPEN cur;\r\n        ins_loop: LOOP\r\n            FETCH cur INTO ids;\r\n            IF done THEN\r\n                LEAVE ins_loop;\r\n            END IF;\r\n            UPDATE last_edit_mall SET last_edit = CURRENT_TIMESTAMP WHERE mall_id = ids;\r\n        END LOOP;\r\n    CLOSE cur;\r\nEND', 'ROW', 'AFTER', NULL, NULL, 'OLD', 'NEW', NULL, 'STRICT_TRANS_TABLES,NO_ENGINE_SUBSTITUTION', 'admin@%', 'utf8mb4', 'utf8mb4_general_ci', 'latin1_swedish_ci');
INSERT INTO `TRIGGERS` VALUES ('def', 'mall', 'delete_trigger_mall_category', 'DELETE', 'def', 'mall', 'mall_category', 1, NULL, 'BEGIN    \r\nDECLARE done INT DEFAULT FALSE;\r\n    DECLARE ids INT;\r\n    DECLARE cur CURSOR FOR SELECT mall_id FROM mall_category_connection WHERE category_id = OLD.id;\r\n    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;\r\n\r\n    OPEN cur;\r\n        ins_loop: LOOP\r\n            FETCH cur INTO ids;\r\n            IF done THEN\r\n                LEAVE ins_loop;\r\n            END IF;\r\n            UPDATE last_edit_mall SET last_edit = CURRENT_TIMESTAMP WHERE mall_id = ids;\r\n        END LOOP;\r\n    CLOSE cur;\r\nEND', 'ROW', 'BEFORE', NULL, NULL, 'OLD', 'NEW', NULL, 'STRICT_TRANS_TABLES,NO_ENGINE_SUBSTITUTION', 'admin@%', 'utf8mb4', 'utf8mb4_general_ci', 'latin1_swedish_ci');
